class Experience {
  constructor(id, year, date, country, institution, title, subtitle, GPA, link) {
    this.id = id;
    this.year = year;
    this.date = date;
    this.country = country;
    this.institution = institution;
    this.title = title;
    this.subtitle = subtitle;
    this.GPA = GPA;
    this.link = link;
  }
}

export default Experience;
